import React, { useState, useEffect, useCallback } from 'react';
import {
  Box,
  Container,
  Typography,
  Paper,
  Grid,
  CircularProgress,
  TextField,
  Button,
  Slider,
  Divider,
  Chip,
} from '@mui/material';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import StopsMap from './components/StopsMap';
import StopsList from './components/StopsList';

interface Stop {
  stop_id: number;
  stop_name: string;
  latitude: number;
  longitude: number;
  routes: string[];
  distance: number;
}

interface Arrival {
  route: string;
  destination: string;
  arrival_time: string;
  minutes: number;
  is_delayed: boolean;
  route_color?: string;
}

interface StopsResponse {
  train_stops: Stop[];
  bus_stops: Stop[];
}

const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
  },
});

const DEFAULT_LOCATION: [number, number] = [41.8781, -87.6298]; // Chicago

function App() {
  const [location, setLocation] = useState<[number, number]>(DEFAULT_LOCATION);
  const [loading, setLoading] = useState(false);
  const [stops, setStops] = useState<StopsResponse>({ train_stops: [], bus_stops: [] });
  const [monitoredStops, setMonitoredStops] = useState<Stop[]>([]);
  const [error, setError] = useState<string | null>(null);

  const getLocation = useCallback(() => {
    if (!navigator.geolocation) {
      setError('Geolocation is not supported by your browser');
      return;
    }

    setLoading(true);
    navigator.geolocation.getCurrentPosition(
      (position) => {
        const newLocation: [number, number] = [
          position.coords.latitude,
          position.coords.longitude
        ];
        setLocation(newLocation);
        fetchNearbyStops(newLocation[0], newLocation[1]);
      },
      (error) => {
        setError('Error getting location: ' + error.message);
        setLoading(false);
      }
    );
  }, []);

  const fetchNearbyStops = async (lat: number, lon: number) => {
    try {
      setLoading(true);
      const response = await fetch(`http://localhost:8000/api/stops?lat=${lat}&lon=${lon}&radius=0.5`);
      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }
      const data = await response.json();
      setStops(data);
      setError(null);
    } catch (err) {
      setError('Error fetching stops: ' + (err as Error).message);
      setStops({ train_stops: [], bus_stops: [] });
    } finally {
      setLoading(false);
    }
  };

  const handleStopSelect = useCallback((stop: Stop) => {
    setMonitoredStops(prev => {
      if (!prev.some(s => s.stop_id === stop.stop_id)) {
        return [...prev, stop];
      }
      return prev;
    });
  }, []);

  const handleStopRemove = useCallback((stopId: number) => {
    setMonitoredStops(prev => prev.filter(s => s.stop_id !== stopId));
  }, []);

  useEffect(() => {
    getLocation();
  }, [getLocation]);

  return (
    <ThemeProvider theme={theme}>
      <Container maxWidth="lg" sx={{ py: 4 }}>
        <Typography variant="h4" component="h1" gutterBottom>
          CTA Transit Tracker
        </Typography>

        {error && (
          <Paper sx={{ p: 2, mb: 2, bgcolor: '#ffebee' }}>
            <Typography color="error">{error}</Typography>
          </Paper>
        )}

        <Button
          variant="contained"
          onClick={getLocation}
          disabled={loading}
          sx={{ mb: 2 }}
        >
          {loading ? <CircularProgress size={24} /> : 'Update Location'}
        </Button>

        <Grid container spacing={2}>
          <Grid item xs={12} md={8}>
            <Paper sx={{ p: 2, mb: 2 }}>
              <StopsMap
                trainStops={stops.train_stops}
                busStops={stops.bus_stops}
                center={location}
                onStopSelect={handleStopSelect}
              />
            </Paper>
          </Grid>
          
          <Grid item xs={12} md={4}>
            <StopsList
              trainStops={stops.train_stops}
              busStops={stops.bus_stops}
              onStopSelect={handleStopSelect}
              monitoredStops={monitoredStops}
            />
          </Grid>
        </Grid>

        {monitoredStops.length > 0 && (
          <Paper sx={{ p: 2, mt: 2 }}>
            <Typography variant="h6" gutterBottom>
              Monitored Stops
            </Typography>
            <Grid container spacing={2}>
              {monitoredStops.map((stop) => (
                <Grid item xs={12} sm={6} md={4} key={stop.stop_id}>
                  <Paper sx={{ p: 2 }}>
                    <Typography variant="subtitle1">{stop.stop_name}</Typography>
                    <Box sx={{ mt: 1, display: 'flex', flexWrap: 'wrap', gap: 0.5 }}>
                      {stop.routes.map((route) => (
                        <Chip
                          key={route}
                          label={route}
                          size="small"
                          variant="outlined"
                          color={stop.routes.length > 1 ? "secondary" : "primary"}
                        />
                      ))}
                    </Box>
                    <Typography variant="body2" sx={{ mt: 1 }}>
                      Distance: {stop.distance.toFixed(2)} miles
                    </Typography>
                    <Button
                      size="small"
                      color="error"
                      onClick={() => handleStopRemove(stop.stop_id)}
                      sx={{ mt: 1 }}
                    >
                      Remove
                    </Button>
                  </Paper>
                </Grid>
              ))}
            </Grid>
          </Paper>
        )}
      </Container>
    </ThemeProvider>
  );
}

export default App;
